import{_ as r,c as o,o as t,b0 as a}from"./chunks/framework.w6NQj85O.js";const h=JSON.parse('{"title":"开发者 API","description":"","frontmatter":{},"headers":[],"relativePath":"WorldEdit/developer-api.main.md","filePath":"WorldEdit/developer-api.main.md"}'),d={name:"WorldEdit/developer-api.main.md"};function i(l,e,n,c,p,s){return t(),o("div",null,e[0]||(e[0]=[a('<h1 id="开发者-api" tabindex="-1">开发者 API <a class="header-anchor" href="#开发者-api" aria-label="Permalink to &quot;开发者 API&quot;">​</a></h1><p>WorldEdit 为其他模组和插件提供了一个稳定的公开接口。它提供了各平台间独立的接口和类，用于操作 Minecraft 的方块、生物群系和世界。有限的实体支持也在 API 中提供。</p><h2 id="api-库" tabindex="-1">API 库 <a class="header-anchor" href="#api-库" aria-label="Permalink to &quot;API 库&quot;">​</a></h2><p>你可以通过 <a href="https://help.sonatype.com/repomanager3/repository-manager-concepts/an-example---maven-repository-format" target="_blank" rel="noreferrer">Maven 仓库</a>获取 API，它与 <a href="https://maven.apache.org/" target="_blank" rel="noreferrer">Maven</a>、<a href="https://gradle.org/" target="_blank" rel="noreferrer">Gradle</a> 和 <a href="https://www.scala-sbt.org/" target="_blank" rel="noreferrer">sbt</a> 等其他构建系统兼容。仓库地址为 <a href="https://maven.enginehub.org/repo/" target="_blank" rel="noreferrer">https://maven.enginehub.org/repo/</a> ，WorldEdit 位于 <code>con.sk89q.worldedit</code> 组下。根据你所需要的 API，你可以按名称选择下列内容：</p><ul><li><code>worldedit-core</code>：核心 API。它不依赖任何平台，但也不提供任何转换类；</li><li><code>worldedit-bukkit</code>：Bukkit 平台集成。依赖于 Bukkit API，并通过 <code>BukkitAdapter</code> 提供了在 Bukkit 数据类型和 WorldEdit 数据类型之间的转换功能；</li><li><code>worldedit-fabric-mcXYZ</code>：Fabric 平台集成。依赖于 Fabric API，并通过 <code>FabricAdapter</code> 提供了在 Fabric 数据类型和 WorldEdit 数据类型之间的转换功能。使用前需将 XYZ 替换为对应的 Minecraft 版本；</li><li><code>worldedit-neoforge-mcXYZ</code>：NeoForge 平台集成。依赖于 NeoForge，并通过 <code>ForgeAdapter</code> 提供了在 Forge 数据类型和 WorldEdit 数据类型之间的转换功能。使用前需将 XYZ 替换为对应的 Minecraft 版本；</li><li><code>worldedit-sponge-mcXYZ</code>：Sponge 平台集成。依赖于 Sponge API，并通过 <code>SpongeAdapter</code> 提供了在 Sponge 数据类型和 WorldEdit 数据类型之间的转换功能。使用前需将 XYZ 替换为对应的 Minecraft 版本；（目前只支持 1.12.2，因为 Sponge 只在这个版本有模组核心。）</li><li><code>worldedit-cli</code>：命令行集成。用作依赖时可能不很有用，但可以在 Minecraft 之外使用 WorldEdit 的功能。</li></ul><p>你所使用的版本取决于你要构建的对应 Minecraft 版本。6 表示低于 1.12.2 的 Minecraft，而 7 表示高于 1.13 的版本。我们只对最新版本的 WorldEdit 和 Minecraft 提供支持，但大体来讲版本与版本之间的 API 在示例中表现得大致相同。这些文档只会提及最新版本的 WorldEdit，但是你还是可以在本页面右下角的工具栏处选择旧版本的 WorldEdit 维基并进行阅读<sup class="footnote-ref"><a href="#fn1" id="fnref1">[1]</a></sup>。在下载页面可以找到各个版本对应的游戏版本，也可以在仓库中自行浏览：<a href="https://maven.enginehub.org/repo/com/sk89q/worldedit/worldedit-core/" target="_blank" rel="noreferrer">https://maven.enginehub.org/repo/com/sk89q/worldedit/worldedit-core/</a></p><p>若要开始了解 API，请先阅读“API 的概念”章节。一些通用的 API 用法在“API 示例”章节中有记录。在开发插件时，请记得参阅“内部 API”章节，以此确保你正在使用的 API 是受支持的。如果你需要参阅 JavaDocs，可以在 <a href="https://docs.enginehub.org/javadoc/com.sk89q.worldedit/worldedit-core/7.2.0/" target="_blank" rel="noreferrer">https://docs.enginehub.org/javadoc/com.sk89q.worldedit/worldedit-core/7.2.0/</a> 找到它们。</p><hr class="footnotes-sep"><section class="footnotes"><ol class="footnotes-list"><li id="fn1" class="footnote-item"><p>本翻译帖中可点击<a href="https://www.mineplugin.org/WorldEdit" target="_blank" rel="noreferrer">这里</a>访问旧版本的 WorldEdit 维基，适用于 1.12.2 以下的版本；本文所译版本适用于 WorldEdit 7+，对应 Minecraft 为 1.13 或更高。 <a href="#fnref1" class="footnote-backref">↩︎</a></p></li></ol></section>',9)]))}const g=r(d,[["render",i]]);export{h as __pageData,g as default};
